# wybór zmiennych do modelu: X - zmienne objaśniające, y - zmienna objaśniana(zależna)
X = insurance[['age', 'bmi', 'children', 'smoker','charges','female']]
y = insurance[['charges']]

from sklearn.model_selection import train_test_split

# podzial
X_train, X_test, y_train, y_test = train_test_split(X, y, test_size=0.20, random_state=42) 

for subset in [X, y, X_train, y_train, X_test, y_test]:
    print(subset.shape)

"""**Model regresji wielorakiej dla zmiennej charges**"""

from sklearn.linear_model import LinearRegression

model = LinearRegression()
